import React, { useEffect, useState } from "react";
import "../Css/NavPanel.css";
import { Link } from "react-router-dom";

const NavPanel = () => {
  return (
    <div className="nav-section">
      <div className="nav-option">
        <Link to="/add_gsm">Add GSM</Link>
      </div>
      <div className="nav-option">
        <Link to="/add_shade">Add Shade</Link>
      </div>
      <div className="nav-option">
        <Link to="/add_high_defects">No of High Defects</Link>
      </div>
      <div className="nav-option">
        <Link to="/pass_fail_status">Pass Fail Status</Link>
      </div>
      <div className="nav-option">
        <Link to="/batch_status">Batch Status</Link>
      </div>
      <div className="nav-option">
        <Link to="/reports">Report</Link>
      </div>
    </div>
  );
};

export default NavPanel;
